import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import anime1 from '../anime/img/bx154587-gHSraOSa0nBG.jpg';
import anime2 from '../anime/img/bx21-YCDoj1EkAxFn.jpg';
import anime3 from '../anime/img/bx16498-73IhOXpJZiMF.jpg';
import anime4 from '../anime/img/bx21087-2OkAdgfnQown.jpg';
import anime5 from '../anime/img/bx101922-WBsBl0ClmgYL.jpg';
import anime6 from '../anime/img/bx113415-bbBWj4pEFseh.jpg';
import anime7 from '../anime/img/bx1535-4r88a1tsBEIz.jpg';

const Anime = () => {
    return (
        <div className="flex">
            <div className="flex-1 flex">
                <div className="m-5 h-[220px] w-[160px] rounded">
                <img src={anime1} alt="Logo" className="h-[220px] w-[160px] rounded" />
                </div>
                <div className="bg-gray-900 m-5 h-[220px] w-[160px] rounded">
                <img src={anime2} alt="Logo" className="h-[220px] w-[160px] rounded" />
                </div>
                <div className="bg-gray-900 m-5 h-[220px] w-[160px] rounded">
                <img src={anime3} alt="Logo" className="h-[220px] w-[160px] rounded" />
                </div>
                <div className="bg-gray-900 m-5 h-[220px] w-[160px] rounded">
                <img src={anime4} alt="Logo" className="h-[220px] w-[160px] rounded" />
                </div>
            </div>

            <div className="flex-1 flex flex-col">
                <div className="m-5 mb-0.5 h-[96px] w-[68px] rounded">
                    <img src={anime1} alt="Logo" className="h-[96px] w-[68px] rounded" />
                </div>
                <div className="m-5 mb-0.5 h-[96px] w-[68px] rounded">
                    <img src={anime2} alt="Logo" className="h-[96px] w-[68px] rounded" />
                </div>
                <div className="m-5 mb-0.5 h-[96px] w-[68px] rounded">
                    <img src={anime3} alt="Logo" className="h-[96px] w-[68px] rounded" />
                </div>
                <div className="m-5 h-[96px] w-[68px] rounded">
                    <img src={anime4} alt="Logo" className="h-[96px] w-[68px] rounded" />
                </div>
                <div className="m-5 h-[96px] w-[68px] rounded">
                    <img src={anime5} alt="Logo" className="h-[96px] w-[68px] rounded" />
                </div>
                <div className="m-5 h-[96px] w-[68px] rounded">
                    <img src={anime6} alt="Logo" className="h-[96px] w-[68px] rounded" />
                </div>
            </div>
                
        </div>
    );
};

export default Anime;
